import React from 'react';
import Logo from './logomain.png'
import './Form.css'

export default function Form() {
    return (
        <div>
            <div className = "form">
                <input type="text" placeholder="Ссылка на проект" className = "snp" />
                <input type="text" placeholder="Название проекта" className = "snp" />
                <input type="text" placeholder="Информация о проекте" className = "snp" />
                <input type="text" placeholder="Финансовая цель" className = "snp" />
                <input type="text" placeholder="Срок окончания проекта" className = "snp" />
                <div className = "gori"><a  class="button b-green gori">Отправить проект</a></div>
            </div>
        </div>
    );
}
